  [],\n\t\"revision_timestamp\": \"2016-08-20T09:39:32.321155\",\n\t\"name\": \"tualatin-river-invasive-species-management-with-volunteers\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This grant has a strong focus on invasive
  species outreach and education with a supporting focus on active field management
  of native/invasive species. With more than 80% of Americans now living in urban
  areas, Tualatin River NWR has an enormous opportunity to conduct invasive species
  outreach and education to a large number of people. We recognize an urgent need
  to build awareness of and participation in prevention and management of invasive
  species, both plant and animal, on and off refuge lands. With over 130,000 annual
  visitors and 150-200 annual volunteers, the refuge is well-positioned to have an
  exponential impact in educating and fostering conservation. We are working to accomplish
  this through: u2022outreach/training for teachers at refuge-hosted teacher workshops
  and the Oregon Science Teachers Association annual conference. u2022volunteer training
  on invasive species issues and follow-up volunteer participation in work parties
  that focus on control of refuge invasive plants and maintenance of restoration sites
  and refuge habitats u2022 special programs/workshops on native gardening, invasive
  species control, Wildlife Center exhibits for the visiting public; and outreach
  at large events such as the annual Tualatin River Bird Festival (draws 600-800 participants)\",\n\t\"license_title\":
